import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="nav-bar">
      <img src="./img/logo.png" alt="" />
      <div className="navigation">
        <NavLink to="/">
          <li>Acceuil</li>
        </NavLink>
        <NavLink to="/films">
          <li>Films</li>
        </NavLink>
        <NavLink to="/series">
          <li>Séries</li>
        </NavLink>
        <NavLink to="/nouveautes">
          <li>Les plus regardés</li>
        </NavLink>
      </div>
    </div>
  );
};

export default NavBar;
